export class AverageSessionModel {
	constructor(data) {
		this.id = data.userId;
		this.sessions = data.sessions;
	}

	getFormatedDays() {
		return this.sessions;
	}

	getAverageTotal() {
		let averageDatas = [];
		this.sessions.forEach((element) => {
			averageDatas.push(element.sessionLength);
		});
		let average = averageDatas.reduce((a, b) => a + b, 0) / averageDatas.length;
		return average;
	}
}
